import React from "react";
import "./HomePage.css";
import bro from "./Used Images/bro.png";
import Ellipse from "./Used Images/Ellipse 190.png";

function HomePage() {
    return (<>
        <div className="container-fluid position-relative main-div">
            <div className="position-relative  main1 d-grid text-center align-item-center over-dib-b  align-self-center">
                <h3 className=""> Elevate <span class="fw-bold">Real Estate Success</span> with</h3>
                <h3> Osumare's Digital Expertise</h3>
                <p className="fs-5">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>
                <button class="btn btn-primary d-grid gap-2 col-3 mx-auto rounded-pill" type="button">Button</button>

                <div className="position-absolute  end-0 col-4 text-end over-div">
                    <img class="back-light" src={Ellipse} />
                </div>
            </div>
            <div class="text-center mt-5">
                <img src={bro}/>
            </div>

        </div>

    </>);
}
export default HomePage;
